import React from 'react';
import './CommodityCard.css';
import PriceChart from './PriceChart';

const CommodityCard = ({ commodity, onQuantityChange, onBuy, onSell }) => {
  const handleQuantityChange = (e) => {
    const newQuantity = parseInt(e.target.value);
    onQuantityChange(commodity.id, newQuantity);
  };

  const handleBuy = () => {
    onBuy(commodity.id);
  };

  const handleSell = () => {
    onSell(commodity.id);
  };

  return (
    <div className="commodity-card">
      <div className="card-header">
        <span className="commodity-icon">{commodity.icon}</span>
        <h3 className="commodity-name">{commodity.name}</h3>
      </div>
      
      <div className="holdings-section">
        <div className="holdings-indicator">
          <span className="holdings-label">Holdings</span>
          <span className="holdings-value">{commodity.holdings.toLocaleString()} {commodity.unit}</span>
        </div>
      </div>
      
      <div className="quantity-section">
        <label className="quantity-label">Quantity:</label>
        <div className="quantity-controls">
          <input
            type="range"
            min="1"
            max="100"
            value={commodity.quantity}
            onChange={handleQuantityChange}
            className="quantity-slider"
          />
          <span className="quantity-value">{commodity.quantity}</span>
        </div>
      </div>
      
      <div className="price-section">
        <div className="last-price">
          <span className="price-label">Last Price</span>
          <span className="price-value">₹{commodity.lastPrice}</span>
        </div>
      </div>
      
      <PriceChart 
        priceHistory={commodity.priceHistory}
        currentPrice={commodity.lastPrice}
      />
      
      <div className="supply-demand">
        <div className="supply">
          <span className="supply-label">Supply</span>
          <span className="supply-value">{commodity.supply.toLocaleString()} {commodity.unit}</span>
        </div>
        <div className="demand">
          <span className="demand-label">Demand</span>
          <span className="demand-value">{commodity.demand.toLocaleString()} {commodity.unit}</span>
        </div>
      </div>
      
      <div className="price-range">
        <div className="buy-price">
          <span className="price-amount">₹{commodity.buyPrice}</span>
          <span className="price-quantity">/ {commodity.buyQuantity.toLocaleString()}</span>
        </div>
        <div className="sell-price">
          <span className="price-amount">₹{commodity.sellPrice}</span>
          <span className="price-quantity">/ {commodity.sellQuantity.toLocaleString()}</span>
        </div>
      </div>
      
      <div className="action-buttons">
        <button className="buy-button" onClick={handleBuy}>
          BUY
        </button>
        <button className="sell-button" onClick={handleSell}>
          SELL
        </button>
      </div>
      
      <div className="calculation">
        <span className="calculation-label">CALCULATION</span>
        <span className="calculation-value">₹{commodity.lastPrice}</span>
      </div>
    </div>
  );
};

export default CommodityCard;
